          '\x3c!-- START doctoc generated TOC please keep comment here to allow auto update --\x3e\n\n\x3c!-- DON\'T EDIT THIS SECTION, INSTEAD RE-RUN doctoc TO UPDATE --\x3e\n\n**Table of Contents**\n\n-   [Signature](#signature)\n-   [Params](#params)\n-   [Return](#return)\n-   [Example](#example)\n\n\x3c!-- END doctoc generated TOC please keep comment here to allow auto update --\x3e\n\nA utility that iterates over an array of object describing \nmedia-queries and returns the value of the first query that \nmatches the current window size.\n\n### Signature\n\n<code>(\n  bps: { widths: Object, misc: Object, }, \n  options: { queries: Object\\[], }\n) => Any </code>\n\n### Params\n\n| param                    | type     | description                                                                                 | default value |\n| ------------------------ | -------- | ------------------------------------------------------------------------------------------- | ------------- |\n| bps                      | object   | An object of named breakpoints to match the queries against                                 |               |\n| bps.widths               | object   | An object of named width-breakpoint and their boundary value                                |               |\n| bps.misc                 | object   | An object of named miscellaneous media-queries                                              |               |\n| options                  | object   |                                                                                             |               |\n| options.queries          | query\\[] | An array of objects describing a media query and the value to return when the query matches | optional      |\n| options.queries\\[].from  | number   | A named width breakpoint used as the min-width boundary point                               | optional      |\n| options.queries\\[].until | number   | A named width breakpoint used as the max-width boundary point                               | optional      |\n| options.queries\\[].misc  | string   | A named misc breakpoint                                                                     | optional      |\n| options.queries\\[].type  | string   | A media type (e.g., `screen`, `print`, etc.)                                                | optional      |\n| options.queries\\[].value | string   | The value to use if the query matches.                                                      | optional      |\n\n### Return\n\nThe value associated with the first query that matches the current window size\n\n### Example\n\n```js\n<span class="hljs-built_in">window</span>.addEventListener(<span class="hljs-string">\'resize\'</span>, (evt) =&gt; <span class="hljs-built_in">console</span>.log(\n  mediaMatchesQuery(\n    {\n      <span class="hljs-attr">widths</span>: { <span class="hljs-attr">s</span>: <span class="hljs-number">640</span>, <span class="hljs-attr">m</span>: <span class="hljs-number">800</span>, <span class="hljs-attr">l</span>: <span class="hljs-number">960</span>, },\n      <span class="hljs-attr">misc</span>: { <span class="hljs-attr">landscape</span>: <span class="hljs-string">\'(orientation: landscape)\'</span>, },\n    },\n    {<span class="hljs-attr">queries</span>: [\n      { <span class="hljs-attr">until</span>: <span class="hljs-string">\'s\'</span>, <span class="hljs-attr">value</span>: <span class="hljs-string">\'BOM!\'</span>, },\n      { <span class="hljs-attr">until</span>: <span class="hljs-string">\'m\'</span>, <span class="hljs-attr">value</span>: <span class="hljs-string">\'BAM!\'</span>, },\n      { <span class="hljs-attr">until</span>: <span class="hljs-string">\'l\'</span>, <span class="hljs-attr">value</span>: <span class="hljs-string">\'BIM!\'</span>, },\n    ],}\n  )\n));\n\n<span class="hljs-comment">// Logs:</span>\n<span class="hljs-comment">//   window.innerWidth &lt;= 639: \'BOM\'</span>\n<span class="hljs-comment">//   window.innerWidth &lt;= 799: \'BAM\'</span>\n<span class="hljs-comment">//   window.innerWidth &lt;= 959: \'BOM\'</span>\n```',
