        content:
          'Gutter widths can also be set on a per breakpoint basis by passing an \nobject with an `onServerRender` key (`number`), for setting the default \ngutter on server render, and a `queries` key, which should be an array of \nobjects specifying meqia-query conditions (`from`, `until`, \n`misc`, `type`) and a `value`. e.g.:\n\n```jsx\n&lt;Grid gutter={{ \n   <span class="hljs-attr">onServerRender</span>: <span class="hljs-number">2</span>, \n   <span class="hljs-attr">queries</span>: [ { <span class="hljs-attr">until</span>: <span class="hljs-string">\'xl\'</span>, <span class="hljs-attr">value</span>: <span class="hljs-number">2</span>, }, { <span class="hljs-attr">from</span>: <span class="hljs-string">\'xl\'</span>, <span class="hljs-attr">value</span>: <span class="hljs-number">4</span>, }, ], }}\n &gt; ... &lt;<span class="hljs-regexp">/Grid&gt;</span>\n```',
